* 帮助器
*
* */
var CommonHelper = /** @class */ (function () {
    function CommonHelper() {
    }
    //数据列表 去重
    CommonHelper.prototype.distinct = function (sourList, target) {
        var ret_list = [];
        if (sourList.length > 0) {
            var _loop_1 = function (i) {
                if (sourList[i].hasOwnProperty(target)) {
                    var index = ret_list.findIndex(function (obj) {
                        return sourList[i][target] == obj[target];
                    });
                    if (index == -1) {
                        ret_list.push(sourList[i]);
                    }
                }
            };
            for (var i = 0; i < sourList.length; i++) {
                _loop_1(i);
            }
            return ret_list;
        }
        else {
            return sourList;
        }
    };
    return CommonHelper;
}());
export { CommonHelper };
